import React, { Component } from 'react'
import axios from 'axios';
import ImageGalleryComponent from './ImageGalleryComponent';
import VideoGalleryComponent from './VideoGalleryComponent';

const masonryOptions = {
    horizontalOrder: true,
    percentPosition: true,
    fitWidth: true
};


class PremiumContentComponent extends Component {
    constructor(props) {
        super();
        this.state = {
            images: [],
            videos: [],
            visible: 10,
            error: false,
            isFree: true,
            masonryOptions: masonryOptions
        }
        //this.loadMore = this.loadMore.bind(this);
    }
    componentDidMount() {
        const self = this;
        axios.get(API_URL + `performer/contents?customer_id=${customerID}&performer_id=${performerID}`)
        .then(function (response) {
            const data = response.data;
            if(data) {
                self.setState({
                    ...self.state,
                    images: data.premiumContents.images,
                    videos: data.premiumContents.videos,
                    isFree: true,
                    loadMore: self.loadMore
                });
            }
        })
        .catch(function (error) {
            this.setState({
                error: true
            });
        });
    }
    loadMore = () => {
        this.setState((prev) => {
          return {visible: prev.visible + 20};
        });
    }
    render() {
        <div class="user-content-block d-none">
            <div class="video-grid">
                <h4 class="free-image-heading">Premium Video</h4>
                    {(this.state.videos > 0) ? <VideoGalleryComponent {...this.state}/> : <EmptyGalleryComponent/>}
            </div>
            <hr class="hr-devider" />
            <div class="img-masgrid">
                <h4 class="free-image-heading">Premium Image</h4>
                    {/* <ul class="grid effect-1"> */}
                        {/* <ImageGalleryComponent {...this.state}/> */}
                    {/* </ul> */}
                    {(this.state.videos > 0) ? <ImageGalleryComponent {...this.state}/> : <EmptyGalleryComponent/>}
            </div>
        </div>
    }
}
export default PremiumContentComponent;
